import React from "react";
import "./Card.css";
const Cards = (props) => {
  return (
    <div className="container">
      <div className="card bg">
        <h1>{props.heading}</h1>
        <p>{props.content}</p>
        <p>{props.desc}</p>
        <span>{props.author}</span>
        <span>{props.date}</span>
      </div>
    </div>
  );
};

export default Cards;
